    "2015-11-20T22:41:00.793570",nt"name": "epa-region-1-tribal-lands",nt"isopen":
    false,nt"url": null,nt"notes": "This is a dataset of Tribal/Native American
    lands in the New England region. EPA notes that there are some disputes over the
    exact boundaries of the territories of the Maine Indian tribes. The data layer which
    identifies tribal lands in New England is not meant to announce the Federal Government's
    final position as to any of those disputes; EPA's use of this data layer is not
    a formal delineation of the Maine Indian tribes' reservations or trust lands; and
    circulation of this data layer is not a final Agency action concerning any of the
    disputes over these boundaries. The Agency has simply attempted to collect readily
    available information about the location of tribal lands so that EPA employees can
    focus their preliminary inquiries about environmental issues in and around tribal
    lands in New England.",nt"license_title": null,nt"extras": [{ntt"key":
